import React from "react";
import { useFormik } from "formik";
import * as Yup from "yup";

const intialValues = {
  username: "",
  email: "",
  password: "",
  confirmpassword: "",
};
function Login() {
  const formik = useFormik({
    intialValues: intialValues,
    onSubmit: (values) => {
      const formdata = {
        username: values.username,
        email: values.email,
        password: values.password,
      };
      console.log(formdata);
    },
  });

  return (
    <div className="container">
      <div className="headingAndBackButton">
        <h1>Enter Login details </h1>
        <div style={{ alignItems: "center", display: "flex" }}>
          <button
            onClick={() => {
              navigate("/");
            }}
          >
            Back
          </button>
        </div>
      </div>
      <div style={{ paddingLeft: "1rem" }}>
        <p>Please enter your address details.</p>
      </div>
      <form className="form" onSubmit={formik.handleSubmit}>
        <div className="fields fields--2">
          <label className="field">
            <span className="field__label" htmlFor="firstname">
              First name
            </span>
            <input
              className="field__input"
              type="text"
              id="firstname"
              name="firstname"
              value={formik.values.firstname}
              onChange={formik.handleChange}
            />
            {formik.errors.firstname && formik.touched.firstname ? (
              <p>{formik.errors.firstname}</p>
            ) : null}
          </label>
          <label className="field">
            <span className="field__label" htmlFor="lastname">
              Last name
            </span>
            <input
              className="field__input"
              type="text"
              id="lastname"
              name="lastname"
              value={formik.values.lastname}
              onChange={formik.handleChange}
            />
            {formik.errors.lastname && formik.touched.lastname ? (
              <p>{formik.errors.lastname}</p>
            ) : null}
          </label>
        </div>
        <label className="field">
          <span className="field__label" htmlFor="address">
            Address
          </span>
          <input
            className="field__input"
            type="text"
            id="address"
            name="address"
            value={formik.values.address}
            onChange={formik.handleChange}
          />
          {formik.errors.address && formik.touched.address ? (
            <p>{formik.errors.address}</p>
          ) : null}
        </label>
        <div className="fields fields--2">
          <label className="field">
            <span className="field__label" htmlFor="country">
              Country
            </span>
            <input
              className="field__input"
              type="text"
              id="country"
              name="country"
              value={formik.values.country}
              onChange={formik.handleChange}
            />
            {formik.errors.country && formik.touched.country ? (
              <p>{formik.errors.country}</p>
            ) : null}
          </label>
          <label className="field">
            <span className="field__label" htmlFor="number">
              Contact no.:
            </span>
            <input
              className="field__input"
              type="number"
              id="number"
              name="number"
              value={formik.values.number}
              onChange={formik.handleChange}
            />
            {formik.errors.number && formik.touched.number ? (
              <p>{formik.errors.number}</p>
            ) : null}
          </label>
        </div>
        <div className="fields fields--3">
          <label className="field">
            <span className="field__label" htmlFor="zipcode">
              Zip code
            </span>
            <input
              className="field__input"
              type="number"
              id="zipcode"
              name="zipcode"
              value={formik.values.zipcode}
              onChange={formik.handleChange}
            />
            {formik.errors.zipcode && formik.touched.zipcode ? (
              <p>{formik.errors.zipcode}</p>
            ) : null}
          </label>
          <label className="field">
            <span className="field__label" htmlFor="city">
              City
            </span>
            <input
              className="field__input"
              type="text"
              id="city"
              name="city"
              value={formik.values.city}
              onChange={formik.handleChange}
            />
            {formik.errors.city && formik.touched.city ? (
              <p>{formik.errors.city}</p>
            ) : null}
          </label>
          <label className="field">
            <span className="field__label" htmlFor="state">
              State
            </span>
            <select
              className="field__input"
              id="state"
              name="state"
              onChange={formik.handleChange}
              value={formik.values.state}
            >
              {indianStates.map((state) => {
                return (
                  <option value={state.value} key={state.value}>
                    {state.name}
                  </option>
                );
              })}
            </select>
          </label>
        </div>
        <div className="outer-div-button-continue">
          <button type="submit" className="continueButton">
            Continue
          </button>
        </div>
      </form>
    </div>
  );
}
export default Login;
